import React, { useState } from 'react';

interface RegistrationFormProps {
  toggleForm: () => void;
}

const RegistrationForm: React.FC<RegistrationFormProps> = ({ toggleForm }) => {
  const [userId, setUserId] = useState('');
  const [password, setPassword] = useState('');
  const [name, setName] = useState('');
  const [age, setAge] = useState('');
  const [address, setAddress] = useState('');
  const [detailedAddress, setDetailedAddress] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [guardianName, setGuardianName] = useState('');
  const [guardianPhoneNumber, setGuardianPhoneNumber] = useState('');

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    // Handle registration logic here
    console.log('Registering with:', { userId, password, name, age, address, detailedAddress, phoneNumber, guardianName, guardianPhoneNumber });
  };

  return (
    <div>
      <h2>Registration Form</h2>
      <form onSubmit={handleSubmit}>
        <input
          id="userId"
          type="text"
          value={userId}
          onChange={(e) => setUserId(e.target.value)}
          placeholder="아이디"
        />
        <input
          id="password"
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          placeholder="비밀번호"
        />
        <input
          id="name"
          type="text"
          value={name}
          onChange={(e) => setName(e.target.value)}
          placeholder="이름"
        />
        <input
          id="age"
          type="number"
          value={age}
          onChange={(e) => setAge(e.target.value)}
          placeholder="나이"
        />
        <input
          id="address"
          type="text"
          value={address}
          onChange={(e) => setAddress(e.target.value)}
          placeholder="주소"
        />
        <input
          id="detailedAddress"
          type="text"
          value={detailedAddress}
          onChange={(e) => setDetailedAddress(e.target.value)}
          placeholder="상세주소"
        />
        <input
          id="phoneNumber"
          type="text"
          value={phoneNumber}
          onChange={(e) => setPhoneNumber(e.target.value)}
          placeholder="전화번호"
        />
        <input
          id="guardianName"
          type="text"
          value={guardianName}
          onChange={(e) => setGuardianName(e.target.value)}
          placeholder="보호자 이름"
        />
        <input
          id="guardianPhoneNumber"
          type="text"
          value={guardianPhoneNumber}
          onChange={(e) => setGuardianPhoneNumber(e.target.value)}
          placeholder="보호자 전화번호"
        />
        <button type="submit">Register</button>
      </form>
    </div>
  );
};

export default RegistrationForm;
